import Link from 'next/link';
import styled from 'styled-components'
import tw from 'tailwind.macro';

// Style 1: Only requires the tw import.
const Spacer = tw.div`py-4`;
const Paragraph = tw.p`flex items-center py-8 justify-center text-xl text-white bg-blue-500`;
// Style 2: Requires both the styled and tw imports.
const Container = styled.div`
    ${tw`flex justify-center`}
`;
const Button = styled.button`
    ${tw`px-8 py-4 text-xl font-semibold text-blue-700 bg-transparent border border-blue-500 rounded hover:bg-blue-500 hover:text-white hover:border-transparent`}
`;

const NavBar = () => (
    <nav>
        <Container className="container px-4 mx-auto flex flex-wrap items-center justify-between">
            <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
                <Link href="/">
                    <a id="logo">
                        <img className="w-32" src="/images/SpaceX-Logo.svg" />
                    </a>
                </Link>
            </div>
            <div className="lg:flex flex-grow items-center" id="example-navbar-danger">
                <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
                    <li className="nav-item">
                        <Link href="/about">
                            <a className="py-2 flex items-center text-xs uppercase font-bold font-poppins text-white hover:opacity-75">About</a>
                        </Link>
                    </li>
                </ul>
            </div>
        </Container>
    </nav>
);

export default NavBar;
